import React, { Fragment } from 'react';

import './AdministratorOrders.css';

const AdministratorOrders = ({ orderID, username, address, phone, totalAmount, status }) => {
    return (
            
        <Fragment>
            <tr>
                <td>{orderID}</td>
                <td>{username}</td>
                <td>{address}</td>
                <td>{phone}</td>
                <td>{totalAmount}</td>
                <td>Danijel Horvat</td>
                <td><span className={`status__${status}`}>{status}</span></td>
            </tr>
        </Fragment>
    )
}

export default AdministratorOrders
